
var KalturaTopicNotificationService={add:function(topicNotification){var kparams=new Object();kparams.topicNotification=topicNotification;return new KalturaRequestBuilder("topicnotification","add",kparams);},deleteAction:function(id){var kparams=new Object();kparams.id=id;return new KalturaRequestBuilder("topicnotification","delete",kparams);},listAction:function(filter){var kparams=new Object();kparams.filter=filter;return new KalturaRequestBuilder("topicnotification","list",kparams);},subscribe:function(topicNotificationId){var kparams=new Object();kparams.topicNotificationId=topicNotificationId;return new KalturaRequestBuilder("topicnotification","subscribe",kparams);},unsubscribe:function(topicNotificationId){var kparams=new Object();kparams.topicNotificationId=topicNotificationId;return new KalturaRequestBuilder("topicnotification","unsubscribe",kparams);},update:function(id,topicNotification){var kparams=new Object();kparams.id=id;kparams.topicNotification=topicNotification;return new KalturaRequestBuilder("topicnotification","update",kparams);}}